  'If a visitor to the website has not selected a preferred language in their browser preferences, or they have selected an unsupported language, then this language will be used. Typically this applies to search engines.' => 'Agar veb-saytga tashrif buyuruvchi brauzer sozlamalarida afzal tilni tanlamagan bo\'lsa yoki qo\'llab-quvvatlanmaydigan tilni tanlagan bo\'lsa, u holda bu til ishlatiladi. Odatda bu qidiruv tizimlariga tegishli.',
  'If this individual has any events other than death, burial, or cremation more recent than this number of years, they are considered to be “alive”. Children’s birth dates are considered to be such events for this purpose.' => 'Agar bu shaxsning o\'limi, dafn etilishidan tashqari boshqa hodisalari bu yillardan ko\'ra yaqinroq bo\'lsa, ular tirik hisoblanadi. Shu maqsadda bolalarning tug\'ilgan kunlari shunday tadbirlar hisoblanadi.',
