  'If you show living individuals to visitors, all other privacy restrictions are ignored. Do this only if all the data in your tree is public.' => 'Agar siz tashrif buyuruvchilarga tirik shaxslarni ko\'rsatsangiz, boshqa barcha maxfiylik cheklovlari e\'tiborga olinmaydi. Buni faqat shajarangizdagi barcha maʼlumotlar ochiq boʻlsagina bajaring.',
  'In many cultures it is customary to have a traditional name spelled in the traditional characters and also a romanized version of the name as it would be spelled or pronounced in languages based on the Latin alphabet, such as English.<br><br>If you prefer to use a non-Latin alphabet such as Hebrew, Greek, Russian, Chinese, or Arabic to enter the name in the standard name fields, then you can use this field to enter the same name using the Latin alphabet. Both versions of the name will appear in lists and charts.<br><br>Although this field is labeled “Romanized”, it is not restricted to containing only characters based on the Latin alphabet. This might be of use with Japanese names, where three different alphabets may occur.' => 'Ko\'pgina madaniyatlarda an\'anaviy ismni an\'anaviy belgilar bilan yozish odat tusiga kiradi, shuningdek, ismning lotin alifbosiga asoslangan tillarda, masalan, ingliz tilida yozilishi yoki talaffuz qilinishining romanlashtirilgan versiyasi mavjud.<br><br>Agar bo\'lsa. standart nom maydonlariga nom kiritish uchun ibroniy, yunon, rus, xitoy yoki arab kabi lotin bo\'lmagan alifbodan foydalanishni afzal ko\'rsangiz, u holda lotin alifbosidan foydalanib bir xil nomni kiritish uchun ushbu maydondan foydalanishingiz mumkin. Ismning ikkala versiyasi ham roʻyxat va diagrammalarda paydo boʻladi.<br><br>Ushbu maydon romanlashtirilgan deb belgilangan boʻlsa-da, u faqat lotin alifbosiga asoslangan belgilarni oʻz ichiga olishi bilan cheklanmaydi. Bu uch xil alifbo bo\'lishi mumkin bo\'lgan yapon nomlari uchun ishlatilishi mumkin.',
  'In many cultures it is customary to have a traditional name spelled in the traditional characters and also a romanized version of the name as it would be spelled or pronounced in languages based on the Latin alphabet, such as English.<br><br>If you prefer to use the Latin alphabet to enter the name in the standard name fields, then you can use this field to enter the same name in the non-Latin alphabet such as Greek, Hebrew, Russian, Arabic, or Chinese. Both versions of the name will appear in lists and charts.<br><br>Although this field is labeled “Hebrew”, it is not restricted to containing only Hebrew characters.' => 'Ko\'pgina madaniyatlarda an\'anaviy ismni an\'anaviy belgilar bilan yozish odat tusiga kiradi, shuningdek, ismning lotin alifbosiga asoslangan tillarda, masalan, ingliz tilida yozilishi yoki talaffuz qilinishining romanlashtirilgan versiyasi mavjud.<br><br>Agar bo\'lsa. standart nom maydonlariga nom kiritish uchun lotin alifbosidan foydalanishni afzal ko\'rsangiz, u holda yunon, ibroniy, rus, arab yoki xitoy kabi lotin bo\'lmagan alifboda bir xil nomni kiritish uchun ushbu maydondan foydalanishingiz mumkin. Ismning ikkala versiyasi ham roʻyxat va diagrammalarda paydo boʻladi.<br><br>Bu maydon ibroniycha deb belgilangan boʻlsa-da, u faqat ibroniycha belgilarni oʻz ichiga olishi bilan cheklanmaydi.',
